import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import movie from './components/movie';

function App() {
  return (
    <div className="App">
      <Navbar />

      <Router>
        <Header />
        <Switch>
          <Route path="/movie" exact component={movie} />
        </Switch>
      </Router>
    </div>


  );
}

export default App;
